import styled from 'styled-components'
import Link from 'next/link'

function AdminSidebar (props) {
    return(
        <SidebarWrapper>
                <SbTitle>ADMIN</SbTitle>
                <SbLinks>
                    <Link href="/admin/dashboard"><a><LinkWrapper id="dashboard-link"><SbLink>Dashboard</SbLink></LinkWrapper></a></Link>
                    <Link href="/admin/users"><a><LinkWrapper><SbLink>Users</SbLink></LinkWrapper></a></Link>
                    <Link href="/admin/streamers"><a><LinkWrapper><SbLink>Streamers</SbLink></LinkWrapper></a></Link>
                    <Link href="/admin/servers"><a><LinkWrapper><SbLink>Servers</SbLink></LinkWrapper></a></Link>
                    <Link href="/admin/reports"><a><LinkWrapper><SbLink>Reports</SbLink></LinkWrapper></a></Link>




                </SbLinks>
        </SidebarWrapper>
    );
}

const SidebarWrapper = styled.div`
    height: 100vh;
    width: 18vw;
    position: fixed;
    z-index: 5;

    display: flex;
    flex-direction: column;
    justify-content: flex-start;

    background-color: #111;
    box-shadow: 4px 0px 4px rgba(0, 0, 0, 0.25);
`;

const SbTitle = styled.h1`
    width: 100%;
    text-align: left;
    font-size: 32px;
    font-weight: 600;
    margin: 10px;
`;

const SbLinks = styled.div`
    width: 100%;
    height: 100%;

    display: flex;
    flex-direction: column;
`;
const LinkWrapper = styled.div`
    width: 90%;
    height: 42px;

    display: flex;
    align-items: center;

    margin: 5px;

    background: #222222;
    box-sizing: border-box;
    border-radius: 0px 12px 12px 0px;

`;
const SbLink = styled.h5`
    margin: 0;
    margin-left: 10px;
`;

export default AdminSidebar;
